/*Table structure for table `acometidas` */

DROP TABLE IF EXISTS `acometidas`;

CREATE TABLE `acometidas` (
  `id_acometida` int(8) NOT NULL AUTO_INCREMENT,
  `niu` int(8) NOT NULL COMMENT 'CODIGO USUARIO',
  `id_nodo` int(10) NOT NULL COMMENT 'CODIGO DE NODO O POSTE',
  `direccion` varchar(100) NOT NULL,
  `cont_ante` int(12) NOT NULL COMMENT 'CONTADOR ANTERIOR',
  `cont_act` int(12) NOT NULL COMMENT 'CONTADOR ACTUAL',
  `cont_marca` varchar(15) NOT NULL COMMENT 'MARCA CONTADOR',
  `lati_usu` double NOT NULL,
  `long_usu` double NOT NULL,
  `alti_usu` double NOT NULL,
  `tip_ca` char(1) NOT NULL COMMENT 'ACOMETIDA CONCENTRICA ,ABIERTA',
  `tip_as` char(1) NOT NULL COMMENT 'ACOMETIDA AEREA O SUBTERRANEA',
  `tip_mbt` char(1) NOT NULL COMMENT 'ACOMETIDA MONOFASICA,FIBASICA,TRIFASICA',
  `tip_rst` char(3) NOT NULL COMMENT 'FASES',
  `calibre` int(4) NOT NULL,
  `tablero` char(1) NOT NULL COMMENT 'S o N',
  `fas_tablero` char(3) NOT NULL COMMENT 'FASE TABLERO',
  `tip_servicio` char(3) NOT NULL COMMENT 'OFICIAL,RESIDENCIAL,COMERCIAL,PROVISIONAL,SERVICIO ASISTENCIAL,',
  `observacion_usu` varchar(255) NOT NULL,
  `fech_levant_usu` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT 'FECHA DE LEVANTAMIENTO',
  PRIMARY KEY (`id_acometida`),
  KEY `id_nodo` (`id_nodo`),
  CONSTRAINT `acometidas_ibfk_1` FOREIGN KEY (`id_nodo`) REFERENCES `tb_postes` (`id_nodo`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;

