/*Table structure for table `postes` */

DROP TABLE IF EXISTS `postes`;

CREATE TABLE `postes` (
  `id_nodo` int(10) NOT NULL AUTO_INCREMENT,
  `nomb_nodo` varchar(25) NOT NULL COMMENT 'CODIGO POSTE',
  `id_trafo_nodo` int(5) NOT NULL COMMENT 'CODIGO TRAFO',
  `lati_nodo` decimal(11,7) NOT NULL COMMENT 'LATITUD',
  `long_nodo` decimal(11,7) NOT NULL COMMENT 'LONGITUD',
  `alti_nodo` int(8) NOT NULL COMMENT 'ALTITUD',
  `altura_nodo` int(4) NOT NULL COMMENT '8,10,12,14',
  `material_nodo` char(3) NOT NULL COMMENT 'CONCRETO ,MADERA, METALICO',
  `estruct_1_nodo` int(4) NOT NULL COMMENT '320,321,322,323,324,610,611,613,615,617,619,621,623',
  `tipo_1_estruct` varchar(10) NOT NULL COMMENT 'TRENZADA O ABIERTA',
  `estruct_2_nodo` int(4) DEFAULT NULL COMMENT '320,321,322,323,324,610,611,613,615,617,619,621,623',
  `tipo_2_estruct` varchar(10) DEFAULT NULL COMMENT 'TRENZADA O ABIERTA',
  `estruct_3_nodo` int(4) DEFAULT NULL COMMENT '320,321,322,323,324,610,611,613,615,617,619,621,623',
  `tipo_3_estruct` varchar(10) DEFAULT NULL COMMENT 'TRENZADA O ABIERTA',
  `estruct_4_nodo` int(4) DEFAULT NULL COMMENT '320,321,322,323,324,610,611,613,615,617,619,621,623',
  `tipo_4_estruct` varchar(10) DEFAULT NULL COMMENT 'TRENZADA O ABIERTA',
  `nr_reten` int(8) NOT NULL COMMENT 'NRO DE RETENIDAS',
  `antiguedad` int(8) NOT NULL,
  `propiedad_nodo` char(3) NOT NULL,
  `nro_acomet` int(8) NOT NULL COMMENT 'NRO ACOMETIDAS',
  `con1` varchar(25) NOT NULL COMMENT 'CONEXION 1',
  `cal_con1` int(5) NOT NULL COMMENT 'CALIBRE CONEXION 1',
  `nhil_con1` int(5) NOT NULL COMMENT 'NUMERO DE HILOS CONEXION1',
  `con2` varchar(25) NOT NULL COMMENT 'CONEXION 2',
  `cal_con2` int(5) NOT NULL COMMENT 'CALIBRE CONEXION 2',
  `nhil_con2` int(5) NOT NULL COMMENT 'NUMERO DE HILOS CONEXION 2',
  `con3` varchar(25) NOT NULL COMMENT 'CONEXION 3',
  `cal_con3` int(5) NOT NULL COMMENT 'CALIBRE CONEXION 3',
  `nhil_con3` int(5) NOT NULL COMMENT 'NUMERO DE HILOS CONEXION 3',
  `con4` varchar(25) NOT NULL COMMENT 'CONEXION 4',
  `cal_con4` int(5) NOT NULL COMMENT 'CALIBRE CONEXION 4',
  `nhil_con4` int(5) NOT NULL COMMENT 'NUMERO DE HILOS CONEXION 4',
  `usu_levant_nodo` int(14) DEFAULT NULL,
  `fech_levant_nodo` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT 'FECHA Y HORA DE LEVANTAMIENTO',
  `observacion_nodo` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id_nodo`),
  KEY `id_trafo` (`id_trafo_nodo`),
  CONSTRAINT `postes_ibfk_1` FOREIGN KEY (`id_trafo_nodo`) REFERENCES `tb_trafos` (`id_trafo`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;

/*Data for the table `postes` */

/*Table structure for table `trafo` */

DROP TABLE IF EXISTS `trafo`;

CREATE TABLE `trafo` (
  `idTrafo` int(7) unsigned NOT NULL AUTO_INCREMENT,
  `nomb_trafo` varchar(10) DEFAULT NULL COMMENT 'CODIGO TRAFO',
  `capacidad` int(8) DEFAULT NULL,
  `zonaur` int(1) DEFAULT NULL COMMENT 'URBANA O RURAL',
  `mpio` varchar(25) DEFAULT NULL,
  `propiedad_trafo` varchar(25) DEFAULT NULL COMMENT 'EEP O PRIVADO',
  `tipo` varchar(50) DEFAULT NULL,
  `lati_trafo` double DEFAULT NULL COMMENT 'LATITUD',
  `long_trafo` double DEFAULT NULL COMMENT 'LONGITUD',
  `alt_trafo` double DEFAULT NULL COMMENT 'ALTITUD',
  `tipo_trafo` varchar(25) DEFAULT NULL COMMENT 'POSTE,PEDESTAL,SUMERGIBLE',
  `fech_levant_trafo` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `observacion_trafo` varchar(255) DEFAULT NULL,
  `nro_postes_trafo` int(4) DEFAULT NULL COMMENT 'NRO DE POSTES CORRESPONDIENTES A ESTE TRAFO',
  `espacio_trafo_poste` varchar(10) DEFAULT NULL,
  `nro_poste_corresp` int(4) DEFAULT NULL COMMENT 'NRO DE POSTE',
  `nomb_nodo` varchar(25) DEFAULT NULL COMMENT 'CODIGO POSTE',
  `id_trafo_nodo` varchar(15) DEFAULT NULL COMMENT 'CODIGO TRAFO_POSTE',
  `lati_nodo` double DEFAULT NULL COMMENT 'LATITUD',
  `long_nodo` double DEFAULT NULL COMMENT 'LONGITUD',
  `alti_nodo` double DEFAULT NULL COMMENT 'ALTITUD',
  `altura_nodo` int(4) DEFAULT NULL COMMENT '8,10,12,14',
  `material_nodo` varchar(15) DEFAULT NULL COMMENT 'CONCRETO ,MADERA, METALICO',
  `estruct_1_nodo` varchar(50) DEFAULT NULL COMMENT '320,321,322,323,324,610,611,613,615,617,619,621,623',
  `tipo_1_estruct` varchar(50) DEFAULT NULL COMMENT 'TRENZADA O ABIERTA',
  `estruct_2_nodo` varchar(50) DEFAULT NULL COMMENT '320,321,322,323,324,610,611,613,615,617,619,621,623',
  `tipo_2_estruct` varchar(50) DEFAULT NULL COMMENT 'TRENZADA O ABIERTA',
  `estruct_3_nodo` varchar(50) DEFAULT NULL COMMENT '320,321,322,323,324,610,611,613,615,617,619,621,623',
  `tipo_3_estruct` varchar(50) DEFAULT NULL COMMENT 'TRENZADA O ABIERTA',
  `estruct_4_nodo` varchar(50) DEFAULT NULL COMMENT '320,321,322,323,324,610,611,613,615,617,619,621,623',
  `tipo_4_estruct` varchar(50) DEFAULT NULL COMMENT 'TRENZADA O ABIERTA',
  `nr_reten` int(8) DEFAULT NULL COMMENT 'NRO DE RETENIDAS',
  `antiguedad` int(8) DEFAULT NULL,
  `propiedad_nodo` varchar(15) DEFAULT NULL,
  `nro_acomet` int(8) DEFAULT NULL COMMENT 'NRO ACOMETIDAS',
  `con1` varchar(25) DEFAULT NULL COMMENT 'CONEXION 1',
  `cal_fase_con1` varchar(25) DEFAULT NULL,
  `cal_neutro_con1` varchar(25) DEFAULT NULL,
  `cal_ap_con1` varchar(25) DEFAULT NULL COMMENT 'CALIBRE CONEXION 1',
  `nhil_con1` varchar(25) DEFAULT NULL COMMENT 'NUMERO DE HILOS CONEXION1',
  `con2` varchar(25) DEFAULT NULL COMMENT 'CONEXION 2',
  `cal_fase_con2` varchar(25) DEFAULT NULL,
  `cal_neutro_con2` varchar(25) DEFAULT NULL,
  `cal_ap_con2` varchar(25) DEFAULT NULL COMMENT 'CALIBRE CONEXION 2',
  `nhil_con2` varchar(25) DEFAULT NULL COMMENT 'NUMERO DE HILOS CONEXION 2',
  `con3` varchar(25) DEFAULT NULL COMMENT 'CONEXION 3',
  `cal_fase_con3` varchar(25) DEFAULT NULL,
  `cal_neutro_con3` varchar(25) DEFAULT NULL,
  `cal_ap_con3` varchar(25) DEFAULT NULL COMMENT 'CALIBRE CONEXION 3',
  `nhil_con3` varchar(25) DEFAULT NULL COMMENT 'NUMERO DE HILOS CONEXION 3',
  `con4` varchar(25) DEFAULT NULL COMMENT 'CONEXION 4',
  `cal_fase_con4` varchar(25) DEFAULT NULL,
  `cal_neutro_con4` varchar(25) DEFAULT NULL,
  `cal_ap_con4` varchar(25) DEFAULT NULL COMMENT 'CALIBRE CONEXION 4',
  `nhil_con4` varchar(25) DEFAULT NULL COMMENT 'NUMERO DE HILOS CONEXION 4',
  `fech_levant_nodo` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT 'FECHA Y HORA DE LEVANTAMIENTO',
  `observacion_nodo` varchar(255) DEFAULT NULL,
  `nro_acometidas` int(4) DEFAULT NULL COMMENT 'NRO DE ACOMETIDAS CORRESPONDIENTES A ESTE POSTE',
  `espacio_poste_acometida` varchar(10) DEFAULT NULL,
  `nro_acometida_corresp` varchar(25) DEFAULT NULL COMMENT 'NRO DE ACOMETIDA',
  `niu` int(8) DEFAULT NULL COMMENT 'CODIGO USUARIO',
  `cont_act` varchar(28) DEFAULT NULL COMMENT 'CONTADOR ACTUAL',
  `id_nodo_usu` varchar(80) DEFAULT NULL COMMENT 'CODIGO DE NODO O POSTE',
  `direccion` varchar(100) DEFAULT NULL,
  `cont_ante` varchar(28) DEFAULT NULL COMMENT 'CONTADOR ANTERIOR',
  `cont_marca` varchar(15) DEFAULT NULL COMMENT 'MARCA CONTADOR',
  `lati_usu` double DEFAULT NULL,
  `long_usu` double DEFAULT NULL,
  `alti_usu` double DEFAULT NULL,
  `tip_ca` char(1) DEFAULT NULL COMMENT 'ACOMETIDA CONCENTRICA ,ABIERTA',
  `tip_as` char(1) DEFAULT NULL COMMENT 'ACOMETIDA AEREA O SUBTERRANEA',
  `tip_mbt` char(1) DEFAULT NULL COMMENT 'ACOMETIDA MONOFASICA,FIBASICA,TRIFASICA',
  `tip_rst` char(3) DEFAULT NULL COMMENT 'FASES',
  `calibre` int(4) DEFAULT NULL,
  `tablero` char(1) DEFAULT NULL COMMENT 'S o N',
  `fas_tablero` char(3) DEFAULT NULL COMMENT 'FASE TABLERO',
  `tip_servicio` varchar(25) DEFAULT NULL COMMENT 'OFICIAL,RESIDENCIAL,COMERCIAL,PROVISIONAL,SERVICIO ASISTENCIAL,',
  `observacion_usu` varchar(255) DEFAULT NULL,
  `fech_levant_usu` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT 'FECHA DE LEVANTAMIENTO',
  `usu_levant_usu` int(14) DEFAULT NULL,
  PRIMARY KEY (`idTrafo`)
